EQUIPES DO MUNDO INTEIRO Q GANHARAM AS DUAS COMPETIÇÕES, DESTACAM A RARIDADE E IMPORTÂNCIA DOS DOIS TÍTULOS. RIVER PLATE E MAIS UM TIME DA INGLATERRA, DIFERENCIAM OS TÍTULOS NAS PAREDES DOS SEUS ESTÁDIOS.
Sendo assim, apenas três CLUBES DO BRASIL, TEM O O MUNDIAL, QUE COMEÇOU A SER UTILIZADO APARTIR DE 2000. SÃO ELES: SÃO PAULO, CORINTHIANS E INTERNACIONAL 👍🏻

